scriptlet.script:
try
{
	var response,firstFiveAuditCode;
	auditCodes;
	arr=auditCodes.split(',');
	var text=[];
	if(arr.length>5)
	{
		for (i = 0; i < 5; i++) 
		{
			x = arr[i];
			text.push(x);

		}

		scriptletContext.put("auditCode[1]",text[0]);
		scriptletContext.put("auditCode[2]",text[1]);
		scriptletContext.put("auditCode[3]",text[2]);
		scriptletContext.put("auditCode[4]",text[3]);
		scriptletContext.put("auditCode[5]",text[4]);
	}
	else
	{
		var t=1;
		for (i = 0; i< arr.length; i++)
		{
			x = arr[i];
			text.push(x);
			scriptletContext.put("auditCode["+t+"]",text[i]);
			t++;
		}

	}
	scriptletContext.put("firstFiveAuditCode",text);

response = "success";
}
catch(err)
{
scriptletContext.put("errorMessage",err.message);
response = "failure";
}
scriptletResponse = response;

